import React, { useEffect } from "react";
import { connect } from "react-redux";
import { Container } from "semantic-ui-react";
import { fetchCart } from "../redux/action/cart";
import { Link } from "react-router-dom";
import { SlideData } from "../data/data";
import Hero from "./Hero";
import Featured from "./Featured";
import img from "../assets/imgs/hero1.jpg";

const Home = ({ fetchCart }) => {
  useEffect(() => {
    fetchCart();
  }, []);

  document.title = "Home | Luxury Silk Online";

  return (
    <>
      <div className="homepage">
        <div className="showcase">
          <img src={img} alt="" />
        </div>
      </div>
    </>
  );
};

export default connect(null, { fetchCart })(Home);
